import React, { Component } from 'react';
import {Redirect} from 'react-router-dom';

import 'antd/dist/antd.css';
import { Menu} from 'antd';
import { NavLink } from 'react-router-dom';


import {
  AppstoreOutlined,
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  PieChartOutlined,
  DesktopOutlined,
  ContainerOutlined,
  MailOutlined,
} from '@ant-design/icons';

class Navigation extends Component {

    constructor(props, context) {
        super(props);

       this.state = {
        collapsed: false
      }
    }

    menuClick=(item)=>{
      console.log(item)
      if(item.key === "1"){
        return  <Redirect  to="/app/abc" />
      }
      else if(item.key === "2"){
        return  <Redirect  to="/app/chat" />
      }

    }

    render() {
        return (
          <div style={{ width: 256 ,height:'100%'}}>
          <Menu
            defaultSelectedKeys={['2']}
            mode="inline"
            theme="dark"
            inlineCollapsed={this.state.collapsed}
          >
            <Menu.Item key="1"  onClick={(item)=>this.menuClick(item)}>
              <PieChartOutlined />
              <span>Option 1</span>
            </Menu.Item>
            <Menu.Item key="2" onClick={(item)=>this.menuClick(item)}>
              <DesktopOutlined />
              <span>
                대화방
              </span>
            </Menu.Item>
            <Menu.Item key="3">
              <ContainerOutlined />
              <span>
              <a href="/app/abc" rel="noopener noreferrer">
                아직미정
              </a>
              </span>
            </Menu.Item>
          </Menu>
          <NavLink

                        to={
                        
                        "/app/chat"
                        }></NavLink>
        </div>
        );
    }
}
export default Navigation;
